import React, { useState } from 'react';
import { Button, ButtonGroup } from 'reactstrap';

export default() => {
  const [rSelected, setRSelected] = useState<number>(1);

  return (
    <ButtonGroup>
      <Button onClick={() => setRSelected(1)} active={rSelected === 1}>One</Button>
      <Button onClick={() => setRSelected(2)} active={rSelected === 2}>Two</Button>
      <Button onClick={() => setRSelected(3)} active={rSelected === 3}>Three</Button>
    </ButtonGroup>
  )
}
